import './Header.css';

function Header() {
  return (
    <div className="Header">
        <img src="" alt="menu"/>
        <h1>color sol</h1>
        <div className='Search'>
            <p>search</p>
            <img src="" alt="menu"/>
        </div>
      
    </div>
  );
}

export default Header;
